import React from 'react';
import { useNavigate } from 'react-router-dom';
import {
  Container,
  Box,
  Typography,
  Button,
  Card,
  CardContent,
} from '@mui/material';
import styled from 'styled-components';

const StyledContainer = styled(Container)`
  height: 100vh;
  display: flex;
  align-items: center;
  justify-content: center;
  background: linear-gradient(45deg, #1976D2 30%, #0D47A1 90%);
`;

const StyledCard = styled(Card)`
  text-align: center;
  padding: 32px;
  max-width: 500px;
  width: 100%;
`;

function Success() {
  const navigate = useNavigate();
  const ticketNumber = '#456981';

  return (
    <StyledContainer>
      <StyledCard>
        <CardContent>
          <Typography variant="h5" gutterBottom>
            Parabéns! Sua carta de VAN foi criada com sucesso.
          </Typography>
          
          <Typography variant="body1" color="text.secondary" paragraph>
            Você receberá suas cartas em anexo via e-mail juntamente com o link do atendimento para acompanhar a abertura do relacionamento com o banco selecionado.
          </Typography>
          
          <Typography variant="body1" color="text.secondary" paragraph>
            Se houver qualquer dúvida, acesse nosso chat aqui.
          </Typography>

          <Box sx={{ mt: 3, mb: 3 }}>
            <Typography variant="h6" color="primary">
              {ticketNumber}
            </Typography>
            <Typography variant="body2" color="text.secondary">
              Link de acesso: https://www.zendesk.com.br/tecnospeed/456981
            </Typography>
          </Box>

          <Button
            variant="contained"
            onClick={() => navigate('/')}
            fullWidth
          >
            Início
          </Button>
        </CardContent>
      </StyledCard>
    </StyledContainer>
  );
}

export default Success;
